    /**
     * description：生成二维码
     * author：wanghua
     */
    function createPhpQrcode(){
        require_once APP_PATH.'../extend/phpqrcode.php';

        $text = input('createErweima');//链接|文字|json
        $outfile = str_replace('index.php','',ROOT_PATH_PRO).'/runtime/qrcode.png';;//默认为false，不生成文件，只将二维码图片返回输出；否则需要给出存放生成二维码图片的文件名及路径；
        $level = QR_ECLEVEL_L;//默认为L，这个参数可传递的值分别是L(QR_ECLEVEL_L，7%)、M(QR_ECLEVEL_M，15%)、Q(QR_ECLEVEL_Q，25%)、H(QR_ECLEVEL_H，30%)，这个参数控制二维码容错率，不同的参数表示二维码可被覆盖的区域百分比，也就是被覆盖的区域还能识别；
        $size = 5;//控制生成图片的大小，默认为4；
        $margin = 4;//控制生成二维码的空白区域大小；（外边距）
        $saveandprint = true;//保存二维码图片并显示出来，$outfile必须传递图片路径；

        \QRcode::png($text,$outfile , $level, $size, $margin, $saveandprint);

        $QR = imagecreatefromstring(file_get_contents($outfile));
        //输出图片
        imagepng($QR, $outfile);
        imagedestroy($QR);
        return '<img src="/runtime/qrcode.png" alt="使用扫描支付">';
    }

