    /**
     * description：天气预报
     * author：wanghua
     */
    function weather(){

        //方法1：
        $city = input('city')?input('city'):'重庆';
        //$url = 'http://wthrcdn.etouch.cn/WeatherApi?city='.trim($city);
        //$html = file_get_contents($url);
        //var_dump(gzdecode($html));die;
        //$data = json_decode(gzdecode($html), true);
        //if($data['status'] != 1000){
        //    brEcho('没有天气信息');die;
        //}
        //foreach($data['data'] as $key=>$val){
        //    var_dump($key);
        //    //if($key == 1){
        //    //
        //    //    var_dump($key);die;
        //    //}
        //    brEcho('=======================================');
        //}
        // 方法2
        $ch = curl_init();
        $timeout = 5;
        curl_setopt($ch, CURLOPT_URL, 'http://wthrcdn.etouch.cn/weather_mini?city='.$city);
        curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
//        curl_setopt($ch,CURLOPT_ENCODING ,'gzip');
        curl_setopt($ch, CURLOPT_CONNECTTIMEOUT, $timeout);
        $file_contents = curl_exec($ch);
        curl_close($ch);

        $data = gzdecode($file_contents);
        $data = json_decode($data, true);

        brEcho("----------【 当前城市：$city 】-----------");
        brEcho('---------------------');
        //var_dump($data['data']['yesterday']);
        foreach($data['data']['yesterday'] as $k=>$v){
            if($k == 'date'){
                $text = '';
                //$text = '<span style="font-size: 22px;color: grey;">'.$v.'</span>';
                echo '-'.$k.$text.':'.$v;
            }else{

                echo '-'.$k.':'.$v;
            }
        }
        brEcho('---------------------');
        foreach($data['data']['forecast'] as $key=>$val){

            foreach($val as $k=>$v){
                $text = '<span style="font-size: 22px;color: red;">'.$v.'</span>';

                if($k == 'date' && mb_substr($v,0,strlen($v)-12)==date('d')){
                    echo '-'.$k.$text.':'.$v;
                }else{

                    echo '-'.$k.':'.$v;
                }
            }
            brEcho('---------------------');

        }

    }


